window.bookSummaryJSON = "<p><b>The sweet human is pregnant with my pup.</b></p> <p>We had one night together, and then she ghosted. Apparently, I'm not part of her \"life plan\".</p> <p><i>Whatever, angel. Plans change.</i></p> <p>She thinks I'm a player. That I won't stick around. She thinks I don't have what it takes to be a dad.</p> <p>That I won't drop everything and dedicate my life to our baby. To our family. To her.</p> <p>She's wrong. She thinks I'll walk away?</p> <p>She has no idea what she's in for. A wolf never walks away from his mate, and he always protects his pups.</p> <p>I may not have marked her yet, but I will.</p> <p>And if she tries to run, I'll follow.</p> <p>I'll hunt my beautiful female to the ends of the Earth.</p>"; 
